import "./App.css";
import Notific from "./components/Notific";
import { useState } from "react";

function App() {
  const [num, setNum] = useState(0);
  let handler = () => {
    setNum(num + 1);
  };
  return (
    <div className="container">
      <div className="navbar">
        <h1></h1>
        <Notific notifCount={num} />
        <button onClick={handler}>click</button>
      </div>
    </div>
  );
}
export default App;
